import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';

class Home extends Component {
    render() {
        return (
            <Container fluid>
                <Row>
                    <Col>
                        <div className="comp home">
                            home
                        </div>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default Home;
